          <!-- Confirm rules title -->\n          <h4 class=\"modal-title\" *ngIf=\"buyStep == 0\" i18n=\"@@modalTitleConfirmRules\">\n            Please confirm before continuing\n          </h4>\n          <!-- BTKS amount title -->\n          <h4 class=\"modal-title\" *ngIf=\"buyStep == 1\" i18n=\"@@modalTitleBtksAmount\">\n            How many Betoken shares do you want to buy?\n          </h4>\n          <!-- BTKS Confirm buy title -->\n          <h4 class=\"modal-title\" *ngIf=\"buyStep == 2\" i18n=\"@@modalTitleConfirmTx\">\n            Confirm transaction\n          </h4>\n          <!-- BTKS Processing buy title -->\n          <h4 class=\"modal-title\" *ngIf=\"buyStep == 3\" i18n=\"@@modalTitleProcessingTx\">\n            Processing transaction\n          </h4>\n          <!-- BTKS confirmed buy title -->\n          <h4 class=\"modal-title\" *ngIf=\"buyStep == 4\" i18n=\"@@modalTitleTxConfirmed\">\n            Transaction confirmed\n          </h4>\n          <!-- Error -->\n          <h4 class=\"modal-title\" *ngIf=\"buyStep == -1\" i18n=\"@@modalTitleError\">\n            That's an error\n          </h4>\n        </div>\n        <!-- Wait until next intermission title -->\n        <h4 class=\"modal-title\" *ngIf=\"phase == 1\" i18n=\"@@modalTitleOpNotPermitted\">\n          Operation not permitted\n        </h4>\n        <!-- Close -->\n        <button type=\"button\" class=\"close\" data-dismiss=\"modal\" i18n-aria-label=\"@@modalAriaLabelClose\" aria-label=\"Close\">\n          <span aria-hidden=\"true\">×</span>\n        </button>\n      </div>\n\n      <!-- Manage phase, buying not allowed -->\n      <div class=\"modal-body\" *ngIf=\"phase == 1\">\n        <img class=\"mb-4 image-fluid w-75 mx-auto d-block\" src=\"assets/img/illustrations/undraw_queue_qt30.svg\" alt=\"\">\n        <!-- Time left until operation allowed -->\n        <h6 class=\"header-pretitle text-secondary mb-2 text-center\" i18n=\"@@modalSubtitleTimeLeft\">\n          Time left until operation allowed\n        </h6>\n        <h4 class=\"header-title mb-4 text-center\">\n          {{days}}<ng-container i18n=\"@@timeLeftInDays\">d</ng-container>&nbsp;{{hours}}<ng-container i18n=\"@@timeLeftInHours\">h</ng-container>&nbsp;{{minutes}}<ng-container i18n=\"@@timeLeftInMinutes\">m</ng-container>&nbsp;{{seconds}}<ng-container i18n=\"@@timeLeftInSeconds\">s</ng-container> <a class=\"text-muted ml-2\"\n            href=\"https://betoken.gitbook.io/docs/betoken-investment-cycle\" i18n-title=\"@@modalTimeLeftUnitsTitleAttribute\" title=\"Learn more\" target=\"_blank\"><span\n              class=\"fe fe-help-circle\"></span></a>\n        </h4>\n        <form action=\"https://fund.us17.list-manage.com/subscribe/post?u=9c0647dcb587985ed6121cdf6&amp;id=150e0f091e\"\n          method=\"post\" id=\"mc-embedded-subscribe-form\" name=\"mc-embedded-subscribe-form\"\n          class=\"validate mb-4 text-center\" target=\"_blank\" novalidate>\n          <label class=\"text-secondary\" for=\"mce-EMAIL\" i18n=\"@@modalBeNotifiedByEmail\">Be notified by email 👇.</label>\n          <div class=\"input-group input-group-lg\">\n            <input class=\"form-control\" type=\"email\" value=\"\" name=\"EMAIL\" id=\"mce-EMAIL\" i18n-placeholder=\"@@modalEmailPlaceholder\" placeholder=\"myemail@address.com\" required>\n            <div style=\"position: absolute; left: -5000px;\" aria-hidden=\"true\"><input type=\"text\"\n                name=\"b_9c0647dcb587985ed6121cdf6_150e0f091e\" tabindex=\"-1\" value=\"\"></div>\n            <div class=\"input-group-append bg-black\">\n              <button class=\"btn btn-dark btn-lg btn-block\" name=\"subscribe\" id=\"mc-embedded-subscribe\">\n                <span class=\"fe fe-send\"></span>\n              </button>\n            </div>\n          </div>\n        </form>\n        <div class=\"row text-center mb-4\">\n          <div class=\"col\">\n            <p class=\"text-secondary mb-2 text-center\" i18n=\"@@modalFollowUs\">Or follow us</p>\n            <a href=\"https://t.me/betokenfund\" class=\"btn btn-rounded-circle btn-white mr-3\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/telegram.svg\" alt=\"telegram logo\" height=\"20\">\n            </a>\n            <a href=\"https://twitter.com/betokenfund\" class=\"btn btn-rounded-circle btn-white mr-3\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/twitter.svg\" alt=\"twitter logo\" height=\"20\">\n            </a>\n            <a href=\"https://medium.com/betoken\" class=\"btn btn-rounded-circle btn-white mr-3\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/medium.svg\" alt=\"medium logo\" height=\"20\">\n            </a>\n            <a href=\"https://github.com/Betoken\" class=\"btn btn-rounded-circle btn-white\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/github.svg\" alt=\"medium logo\" height=\"20\">\n            </a>\n          </div>\n        </div>\n        <!-- Close button for buyStep 5 and buying not allowed page -->\n        <button type=\"submit\" class=\"btn btn-block btn-white mt-auto\" data-dismiss=\"modal\" i18n-aria-label=\"@@modalAriaLabelClose\" aria-label=\"Close\" i18n=\"@@modalCtaClose\">\n          Close\n        </button>\n      </div>\n\n      <!-- Intermission, buying allowed -->\n      <div class=\"card-header py-0 border-0\" style=\"min-height: 24px;\" *ngIf=\"phase == 0\">\n        <div class=\"progress\" style=\"height: 8px;\">\n          <div [ngClass]=\"{'bg-success': buyStep >= 0, 'bg-secondary': buyStep !== 0}\" class=\"progress-bar\"\n            role=\"progressbar\" style=\"width: 20%\" aria-valuenow=\"20\" aria-valuemin=\"0\" aria-valuemax=\"100\"></div>\n          <div [ngClass]=\"{'bg-success': buyStep >= 1, 'bg-secondary': buyStep !== 1}\" class=\"progress-bar border-left\"\n            role=\"progressbar\" style=\"width: 20%\" aria-valuenow=\"20\" aria-valuemin=\"0\" aria-valuemax=\"100\"></div>\n          <div [ngClass]=\"{'bg-success': buyStep >= 2, 'bg-secondary': buyStep !== 2}\" class=\"progress-bar border-left\"\n            role=\"progressbar\" style=\"width: 20%\" aria-valuenow=\"20\" aria-valuemin=\"0\" aria-valuemax=\"100\"></div>\n          <div [ngClass]=\"{'bg-success': buyStep >= 3, 'bg-secondary': buyStep !== 3}\" class=\"progress-bar border-left\"\n            role=\"progressbar\" style=\"width: 20%\" aria-valuenow=\"20\" aria-valuemin=\"0\" aria-valuemax=\"100\"></div>\n          <div [ngClass]=\"{'bg-success': buyStep >= 4, 'bg-secondary': buyStep !== 4}\" class=\"progress-bar border-left\"\n            role=\"progressbar\" style=\"width: 20%\" aria-valuenow=\"20\" aria-valuemin=\"0\" aria-valuemax=\"100\"></div>\n        </div>\n      </div>\n\n      <div class=\"modal-body\" *ngIf=\"phase == 0\">\n        <!-- before starting confirm rules -->\n        <div *ngIf=\"buyStep == 0\">\n          <div class=\"custom-control custom-checkbox mb-4\">\n            <input type=\"checkbox\" class=\"custom-control-input\" id=\"rule1\" (change)=\"checkboxes[0] = !checkboxes[0]\">\n            <label class=\"custom-control-label small text-secondary\" for=\"rule1\" i18n=\"@@modalRule1\">You are NEITHER a citizen or resident\n              of, NOR currently located in any of the following states or territories, NOR an entity formed under the\n              laws of: Afghanistan, Cuba, Democratic People's Republic of Korea, Iran, Iraq, People’s Republic of China,\n              Russian Federation, Somalia, Sudan, Syria, United Arab Emirates, United States of America, Venezuela,\n              Yemen.</label>\n          </div>\n          <div class=\"custom-control custom-checkbox mb-4\">\n            <input type=\"checkbox\" class=\"custom-control-input\" id=\"rule2\" (change)=\"checkboxes[1] = !checkboxes[1]\">\n            <label class=\"custom-control-label small text-secondary\" for=\"rule2\" i18n=\"@@modalRule2\">You have read and understood our\n              disclaimer below.</label>\n          </div>\n          <div class=\"custom-control custom-checkbox mb-4\">\n            <input type=\"checkbox\" class=\"custom-control-input\" id=\"rule3\" (change)=\"checkboxes[2] = !checkboxes[2]\">\n            <label class=\"custom-control-label small text-danger\" for=\"rule3\" i18n=\"@@modalRule3\">💀 You understand that Betoken Protocol is\n              in beta. Use at your own risk.</label>\n          </div>\n          <div class=\"card card-inactive mb-4\">\n            <div class=\"card-body\">\n              <h3 i18n=\"@@disclaimerTitle\">Disclaimer</h3>\n              <p class=\"text-muted\" i18n=\"@@disclaimertext1\">\n                Nothing herein constitutes an offer to sell, or the solicitation of an offer to buy, any securities or\n                tokens.\n              </p>\n              <p class=\"text-muted\" i18n=\"@@disclaimertext2\">\n                Betoken enables capital connection and managing using smart contracts which are open source. Betoken\n                does not take custody of tokens and is only a collaborative hub for investors and managers. Betoken is\n                not a licensed bank, broker-dealer, investment advisor or an exchange. Betoken uses partner protocols\n                (Kyber, Compound, bZx, Maker DAO) to power its own ecosystem.\n              </p>\n            </div>\n          </div>\n        </div>\n\n        <!-- Step 1: enter amount -->\n\n        <!-- Quantity of share to buy -->\n        <div *ngIf=\"buyStep == 1\">\n          <h6 class=\"header-pretitle\" i18n=\"@@price\">\n            Price (DAI)\n          </h6>\n          <h4 class=\"mb-5\">\n            {{sharesPrice.toFormat(4)}}\n          </h4>\n          <h6 class=\"header-pretitle text-secondary\" i18n=\"@@investorBuyBtksModalIWantToBuyWith\">I want to buy Betoken shares with</h6>\n          <div class=\"row justify-content-center mb-4\">\n            <div class=\"col\">\n              <div class=\"row align-items-center\">\n                <div class=\"col\">\n                  <form>\n                    <div class=\"form-group row mb-2\">\n                      <div class=\"col\">\n                        <div class=\"input-group\">\n                          <input aria-describedby=\"Betoken Shares Amount to buy\"\n                            class=\"form-control form-control-lg pr-0\" type=\"number\" placeholder=\"0.0\"\n                            id=\"sharesAmountToBuy\"\n                            (input)=\"refreshBuyOrderDetails($event.target.value); continueEnabled = true\">\n                          <div class=\"input-group-append\">\n                            <button class=\"btn btn-white\" name=\"button\" type=\"button\"\n                              (click)=\"maxBuyAmount()\" i18n=\"@@modalCtaMax\">Max</button>\n                          </div>\n                        </div>\n                      </div>\n                      <div class=\"col\">\n                        <select class=\"form-control form-control-lg\" id=\"buyTokenSelect\"\n                          (change)=\"selectBuyToken($event.target.value)\">\n                          <option *ngFor=\"let token of tokenData\">{{token.symbol}}</option>\n                        </select>\n                      </div>\n                    </div>\n                    <small class=\"form-text text-secondary d-inline-block mb-0\">{{selectedTokenBalance.toFormat(4)}}\n                      {{selectedTokenSymbol}}&nbsp;<ng-container i18n=\"@@modalBalanceAvailable\">available</ng-container></small>\n                  </form>\n                </div>\n              </div>\n            </div>\n          </div>\n          <div class=\"table-responsive\">\n            <table class=\"table mb-4\">\n              <thead>\n                <tr>\n                  <th class=\"px-0 bg-transparent border-top-0\">\n                    <span class=\"h6\" i18n=\"@@modalTitleOrderDetail\">Order Details</span>\n                  </th>\n                </tr>\n              </thead>\n              <tbody>\n                <tr>\n                  <td class=\"px-0 small align-baseline text-muted\" i18n=\"@@modalBtksToReceive\">\n                    Betoken shares to receive\n                  </td>\n                  <td class=\"px-0 text-right small align-baseline\">\n                    {{buySharesAmount.toFormat(4)}} BTKS\n                  </td>\n                </tr>\n                <tr>\n                  <td class=\"px-0 small align-baseline text-muted\" i18n=\"@@modalTotalCost\">\n                    Total cost\n                  </td>\n                  <td class=\"px-0 text-right h3 align-baseline\">\n                    {{buyTokenAmount.toFormat(6)}} {{selectedTokenSymbol}}\n                  </td>\n                </tr>\n              </tbody>\n            </table>\n          </div>\n        </div>\n\n\n        <!-- Step 2: confirm transaction -->\n        <!-- loader -->\n        <img class=\"image-fluid d-block mx-auto mb-4\" src=\"assets/img/animated-logo.svg\" alt=\"Betoken logo\"\n          style=\"width: 88px;\" *ngIf=\"buyStep == 3 || buyStep === 2\">\n        <p class=\"text-center text-muted mb-5\" *ngIf=\"buyStep == 2\" i18n=\"@@modalBodyTextStep1\">\n          Confirm the transaction in your wallet’s interface to save it on the Ethereum blockchain. It's fine to stick\n          with these defaults gas limit and price.\n        </p>\n\n        <!-- Step 3: transaction broadcasted -->\n        <!-- Processing transaction body -->\n        <div *ngIf=\"buyStep == 3\">\n          <p class=\"text-center text-muted mb-5\" i18n=\"@@modalBodyTextTxBroadcasted\">\n            Your transaction is being saved on the Ethereum blockchain.\n          </p>\n          <hr>\n          <form>\n            <div class=\"form-group\">\n              <label for=\"exampleFormControlInput1\" i18n=\"@@modalBodyTxHash\">Transaction hash</label>\n              <div class=\"input-group mb-3\">\n                <input type=\"text\" class=\"form-control form-control-lg\" value=\"{{transactionId}}\"\n                  aria-label=\"Transaction hash\" aria-describedby=\"\">\n                <div class=\"input-group-append\">\n                  <a class=\"btn btn-white h-100 d-flex align-items-center\"\n                    href=\"https://etherscan.io/tx/{{transactionId}}\" target=\"_blank\"><i\n                      class=\"fe fe-external-link\"></i></a>\n                </div>\n              </div>\n            </div>\n          </form>\n        </div>\n\n        <!-- Step 4: transaction confirmed -->\n        <!-- Investment confirmed body -->\n        <div *ngIf=\"buyStep == 4\">\n          <p class=\"h1 text-center\">\n            <i class=\"fe fe-check-circle text-success\"></i>\n          </p>\n          <p class=\"text-center text-muted mb-5\">\n            <ng-container i18n=\"@@investorBuyBtksModalTextStep4a\">You bought</ng-container> <span class=\"font-weight-bold text-secondary\">{{buySharesAmount.toFormat(4)}}</span>&nbsp;BTKS&nbsp;<ng-container i18n=\"@@investorBuyBtksModalTextStep4b\">using</ng-container>\n            <span class=\"font-weight-bold text-secondary\">{{buyTokenAmount.toFormat(4)}}</span>&nbsp;{{selectedTokenSymbol}}.\n          </p>\n          <a class=\"btn btn-twitter btn-block\" target=\"__blank\"\n            href=\"https://twitter.com/intent/tweet?hashtags=Betoken%2C%20DeFi&related=betokenfund&text=I%27ve%20just%20connected%20my%20capital%20to%20Betoken%2C%20world%27s%20first%20crowd-powered%20cryptoassets%20management%20protocol!&url=https%3A%2F%2Fbetoken.fund&via=betokenfund\" i18n=\"@@investorBuyBtksModalTweet\">Tweet\n            about it</a>\n          <hr>\n          <form>\n            <div class=\"form-group\">\n              <label for=\"exampleFormControlInput1\" i18n=\"@@modalBodyTxHash\">Transaction hash</label>\n              <div class=\"input-group mb-3\">\n                <input type=\"text\" class=\"form-control form-control-lg\" value=\"{{transactionId}}\"\n                  aria-label=\"Transaction hash\" aria-describedby=\"\">\n                <div class=\"input-group-append\">\n                  <a class=\"btn btn-white h-100 d-flex align-items-center\" href=\"https://etherscan.io/tx/{{transactionId}}\" target=\"_blank\"><i class=\"fe fe-external-link\"></i></a>\n                </div>\n              </div>\n            </div>\n          </form>\n        </div>\n\n        <!-- error -->\n        <div *ngIf=\"buyStep == -1\">\n          <p class=\"h1 text-center\">\n            <i class=\"fe fe-alert-circle text-danger\"></i>\n          </p>\n          <p class=\"text-center text-muted mb-5\" i18n=\"@@modalErrorText\">\n            The operation has resulted in an error. Please try again.\n          </p>\n          <p class=\"text-center text-muted mb-5\">\n            <ng-container i18n=\"@@modalErrorMsg\">Error message:</ng-container>&nbsp;{{errorMsg}}\n          </p>\n        </div>\n\n\n        <!-- Continue button for buyStep 1 -->\n        <button type=\"submit\" class=\"btn btn-block btn-success mt-auto\" i18n-aria-label=\"@@investorBuyBtksModalCtaBuyAriaLabel\" aria-label=\"BuyBTKS\" *ngIf=\"buyStep == 0\"\n          (click)=\"buyStep = agreementsChecked() ? 1 : 0\" [ngClass]=\"{'disabled': !agreementsChecked()}\" i18n=\"@@investorBuyBtksModalCtaBuy\">\n          Buy Betoken shares\n        </button>\n        <!-- Continue button for buyStep 2 -->\n        <button type=\"submit\" class=\"btn btn-block btn-success mt-auto\" i18n-aria-label=\"@@modalCtaContinueAriaLabel\" aria-label=\"Continue to Buy\"\n          *ngIf=\"buyStep == 1\" (click)=\"deposit();\" [disabled]=\"!continueEnabled\" i18n=\"@@modalCtaContinue\">\n          Continue\n        </button>\n        <!-- Close button for buyStep 4 -->\n        <button type=\"submit\" class=\"btn btn-block btn-white mt-auto\" data-dismiss=\"modal\" i18n-aria-label=\"@@modalAriaLabelClose\" aria-label=\"Close\"\n          *ngIf=\"buyStep == 4\" i18n=\"@@modalCtaClose\">\n          Close\n        </button>\n        <!-- Try again button for error -->\n        <button type=\"submit\" class=\"btn btn-block btn-white mt-auto\" i18n=\"@@modalTryAgainAriaLabel\" aria-label=\"Try again\" *ngIf=\"buyStep == -1\"\n          (click)=\"resetModals()\" i18n=\"@@modalTryAgain\">\n          Try again\n        </button>\n      </div>\n    </div>\n  </div>\n</div><!-- / modal -->\n\n<!-- Sell BTKS modal -->\n<div class=\"modal fade fixed-right\" id=\"modalInvestorSell\" tabindex=\"-1\" role=\"dialog\"\n  aria-labelledby=\"modalInvestorSell\" aria-hidden=\"true\">\n  <div class=\"modal-dialog modal-dialog-vertical\" role=\"document\">\n    <div class=\"modal-content\" data-toggle=\"lists\" data-lists-values=\"[&quot;name&quot;]\">\n      <div class=\"modal-header border-0\">\n        <div *ngIf=\"phase == 0\">\n          <!-- BTKS amount title -->\n          <h4 class=\"modal-title\" *ngIf=\"sellStep == 0\" i18n=\"@@investorSellBtksModalTitleStep0\">\n            How many Betoken shares do you want to sell?\n          </h4>\n          <!-- BTKS Confirm Sell title -->\n          <h4 class=\"modal-title\" *ngIf=\"sellStep == 1\" i18n=\"@@modalTitleConfirmTx\">\n            Confirm transaction\n          </h4>\n          <!-- BTKS Processing Sell title -->\n          <h4 class=\"modal-title\" *ngIf=\"sellStep == 2\" i18n=\"@@modalTitleProcessingTx\">\n            Processing transaction\n          </h4>\n          <!-- BTKS confirmed Sell title -->\n          <h4 class=\"modal-title\" *ngIf=\"sellStep == 3\" i18n=\"@@modalTitleTxConfirmed\">\n            Transaction Confirmed\n          </h4>\n          <!-- Error -->\n          <h4 class=\"modal-title\" *ngIf=\"sellStep == -1\" i18n=\"@@modalTitleError\">\n            That's an error\n          </h4>\n        </div>\n        <div *ngIf=\"phase == 1\">\n          <h4 class=\"modal-title\" i18n=\"@@investorSellBtksModalTitleOperationNonPermitted\">\n            Operation not permitted\n          </h4>\n        </div>\n        <!-- Close -->\n        <button type=\"button\" class=\"close\" data-dismiss=\"modal\" i18n-aria-label=\"@@modalAriaLabelClose\" aria-label=\"Close\">\n          <span aria-hidden=\"true\">×</span>\n        </button>\n      </div>\n\n      <!--Intermission phase, selling allowed-->\n      <div class=\"card-header py-0 border-0\" style=\"min-height: 24px;\" *ngIf=\"phase == 0\">\n        <div class=\"progress\" style=\"height: 8px;\">\n          <div [ngClass]=\"{'bg-success': sellStep >= 0, 'bg-secondary': sellStep !== 0}\" class=\"progress-bar\"\n            role=\"progressbar\" style=\"width: 25%\" aria-valuenow=\"20\" aria-valuemin=\"0\" aria-valuemax=\"100\"></div>\n          <div [ngClass]=\"{'bg-success': sellStep >= 1, 'bg-secondary': sellStep !== 1}\"\n            class=\"progress-bar border-left\" role=\"progressbar\" style=\"width: 25%\" aria-valuenow=\"20\" aria-valuemin=\"0\"\n            aria-valuemax=\"100\"></div>\n          <div [ngClass]=\"{'bg-success': sellStep >= 2, 'bg-secondary': sellStep !== 2}\"\n            class=\"progress-bar border-left\" role=\"progressbar\" style=\"width: 25%\" aria-valuenow=\"20\" aria-valuemin=\"0\"\n            aria-valuemax=\"100\"></div>\n          <div [ngClass]=\"{'bg-success': sellStep >= 3, 'bg-secondary': sellStep !== 3}\"\n            class=\"progress-bar border-left\" role=\"progressbar\" style=\"width: 25%\" aria-valuenow=\"20\" aria-valuemin=\"0\"\n            aria-valuemax=\"100\"></div>\n        </div>\n      </div>\n      <div class=\"modal-body\" *ngIf=\"phase == 0\">\n        <!-- Step 0: enter amount of shares to sell -->\n        <div *ngIf=\"sellStep == 0\">\n          <h6 class=\"header-pretitle\" i18n=\"@@price\">\n            Price (DAI)\n          </h6>\n          <h4 class=\"mb-5\">\n            {{sharesPrice.toFormat(4)}}\n          </h4>\n\n          <h6 class=\"header-pretitle text-secondary\" i18n=\"@@investorSellBtksModalIWantToSell\">I want to sell</h6>\n\n          <div class=\"row justify-content-center mb-4\">\n            <div class=\"col\">\n              <!--Form for entering the sell amount-->\n              <form>\n                <div class=\"input-group mb-2\">\n                  <input type=\"number\" min=\"0.0\" class=\"form-control form-control-lg border-right-0 pr-0\"\n                    aria-describedby=\"Betoken Shares Amount to sell\" placeholder=\"0.0\" id=\"sharesAmountToSell\"\n                    (input)=\"refreshSellOrderDetails($event.target.value)\">\n                  <div class=\"input-group-append\">\n                    <span class=\"input-group-text border-left-0 border-right-0\" id=\"maxSellPercentUnit\">BTKS</span>\n                    <button class=\"btn btn-white\" name=\"button\" type=\"button\" (click)=\"maxSellAmount()\" i18n=\"@@modalCtaMax\">Max</button>\n                  </div>\n                </div>\n                <small class=\"form-text text-secondary d-inline-block mb-0\">{{sharesBalance.toFormat(4)}}&nbsp;BTKS&nbsp;<ng-container i18n=\"@@modalBalanceAvailable\">available</ng-container></small>\n              </form>\n            </div>\n          </div>\n\n          <h6 class=\"header-pretitle text-secondary\" i18n=\"@@investorSellBtksModalIWantToReceive\">I want to receive</h6>\n\n          <div class=\"form-group\">\n            <select class=\"form-control\" id=\"sellTokenSelect\" (change)=\"selectSellToken($event.target.selectedIndex)\">\n              <option *ngFor=\"let token of tokenData\">\n                {{token.name}} ({{token.symbol}})\n              </option>\n            </select>\n          </div>\n\n          <div class=\"table-responsive\">\n            <table class=\"table mb-4\">\n              <thead>\n                <tr>\n                  <th class=\"px-0 bg-transparent border-top-0\">\n                    <span class=\"h6\" i18n=\"@@modalTitleOrderDetail\">Order Details</span>\n                  </th>\n                </tr>\n              </thead>\n              <tbody>\n                <tr>\n                  <td class=\"px-0 small align-baseline text-muted\" i18n=\"@@investorSellBtksModalSellBtksFor\">\n                    Sell Betoken shares for\n                  </td>\n                  <td class=\"px-0 text-right h3 align-baseline\">\n                    {{sellTokenAmount.toFormat(6)}} {{selectedTokenSymbol}}\n                  </td>\n                </tr>\n              </tbody>\n            </table>\n          </div>\n        </div>\n\n        <!-- Step 1: confirm transaction -->\n        <!-- loader -->\n        <img class=\"image-fluid d-block mx-auto mb-4\" src=\"assets/img/animated-logo.svg\" alt=\"Betoken logo\"\n          style=\"width: 88px;\" *ngIf=\"sellStep == 1 || sellStep === 2\">\n        <p class=\"text-center text-muted mb-5\" *ngIf=\"sellStep == 1\" i18n=\"@@modalBodyTextStep1\">\n          Confirm the transaction in your wallet’s interface to save it on the Ethereum blockchain. It's fine to stick\n          with these defaults gas limit and price.\n        </p>\n\n        <!-- Step 2: transaction broadcasted -->\n        <!-- Processing transaction body -->\n        <div *ngIf=\"sellStep == 2\">\n          <p class=\"text-center text-muted mb-5\" i18n=\"@@modalBodyTextTxBroadcasted\">\n            Your transaction is being saved on the Ethereum blockchain.\n          </p>\n          <hr>\n          <form>\n            <div class=\"form-group\">\n              <label for=\"exampleFormControlInput1\" i18n=\"@@modalBodyTxHash\">Transaction hash</label>\n              <div class=\"input-group mb-3\">\n                <input type=\"text\" class=\"form-control form-control-lg\" value=\"{{transactionId}}\"  i18n-aria-label=\"@@investorSellBtksModalTxHashStep2AriaLabel\" aria-label=\"Transaction hash\">\n                <div class=\"input-group-append\">\n                  <a class=\"btn btn-white h-100 d-flex align-items-center\"\n                    href=\"https://etherscan.io/tx/{{transactionId}}\" target=\"_blank\"><i\n                      class=\"fe fe-external-link\"></i></a>\n                </div>\n              </div>\n            </div>\n          </form>\n        </div>\n\n        <!-- Step 3: transaction confirmed -->\n        <!-- Sell order confirmed body -->\n        <div *ngIf=\"sellStep == 3\">\n          <p class=\"h1 text-center\">\n            <i class=\"fe fe-check-circle text-success\"></i>\n          </p>\n          <p class=\"text-center text-muted mb-5\">\n            <ng-container i18n=\"@@investorSellBtksModalTextStep3a\">You sold</ng-container>&nbsp;<span class=\"font-weight-bold text-secondary\">{{sellSharesAmount.toFormat(6)}}</span>&nbsp;BTKS&nbsp;<ng-container i18n=\"@@investorSellBtksModalTextStep3b\">for</ng-container>&nbsp;<span class=\"font-weight-bold text-secondary\">{{sellTokenAmount.toFormat(6)}}</span>&nbsp;{{selectedTokenSymbol}}.\n          </p>\n          <hr>\n          <form>\n            <div class=\"form-group\">\n              <label for=\"exampleFormControlInput1\" i18n=\"@@modalBodyTxHash\">Transaction hash</label>\n              <div class=\"input-group mb-3\">\n                <input type=\"text\" class=\"form-control form-control-lg\" value=\"{{transactionId}}\"\n                  aria-label=\"Transaction hash\" i18-aria-label>\n                <div class=\"input-group-append\">\n                  <a class=\"btn btn-white h-100 d-flex align-items-center\"\n                    href=\"https://etherscan.io/tx/{{transactionId}}\" target=\"_blank\"><i\n                      class=\"fe fe-external-link\"></i></a>\n                </div>\n              </div>\n            </div>\n          </form>\n        </div>\n\n        <!-- error -->\n        <div *ngIf=\"sellStep == -1\">\n          <p class=\"h1 text-center\">\n            <i class=\"fe fe-alert-circle text-danger\"></i>\n          </p>\n          <p class=\"text-center text-muted mb-5\" i18n=\"@@modalErrorText\">\n            The operation has resulted in an error. Please try again.\n          </p>\n          <p class=\"text-center text-muted mb-5\">\n            <ng-container i18n=\"@@modalErrorMsg\">Error message:</ng-container>&nbsp;{{errorMsg}}\n          </p>\n        </div>\n\n        <!-- Continue button for step 0 -->\n        <button type=\"submit\" class=\"btn btn-block btn-success mt-auto\" aria-label=\"Continue to Sell\"\n          *ngIf=\"sellStep == 0\" (click)=\"sell()\" i18n=\"@@modalCtaContinue\">\n          Continue\n        </button>\n\n        <!-- Close button for step 3 -->\n        <button type=\"submit\" class=\"btn btn-block btn-white mt-auto\" data-dismiss=\"modal\" i18n-aria-label=\"@@modalAriaLabelClose\" aria-label=\"Close\"\n          *ngIf=\"sellStep == 3\" i18n=\"@@modalCtaClose\">\n          Close\n        </button>\n\n        <!-- Try again button for error -->\n        <button type=\"submit\" class=\"btn btn-block btn-white mt-auto\" i18n=\"@@modalTryAgainAriaLabel\" aria-label=\"Try again\"\n          *ngIf=\"sellStep == -1\" (click)=\"resetModals()\" i18n=\"@@modalTryAgain\">\n          Try again\n        </button>\n      </div>\n\n\n      <!--Manage phase, selling not allowed-->\n      <div class=\"modal-body\" *ngIf=\"phase == 1\">\n        <img class=\"mb-4 image-fluid w-75 mx-auto d-block\" src=\"assets/img/illustrations/undraw_queue_qt30.svg\" alt=\"\">\n        <!-- Time left until next intermission phase -->\n        <h6 class=\"header-pretitle text-secondary mb-2 text-center\" i18n=\"@@modalSubtitleTimeLeft\">\n          Time left until operation allowed\n        </h6>\n        <h4 class=\"header-title mb-4 text-center\">\n          {{days}}<ng-container i18n=\"@@timeLeftInDays\">d</ng-container>&nbsp;{{hours}}<ng-container i18n=\"@@timeLeftInHours\">h</ng-container>&nbsp;{{minutes}}<ng-container i18n=\"@@timeLeftInMinutes\">m</ng-container>&nbsp;{{seconds}}<ng-container i18n=\"@@timeLeftInSeconds\">s</ng-container> <a class=\"text-muted ml-2\"\n            href=\"https://betoken.gitbook.io/docs/betoken-investment-cycle\" i18n-title=\"@@modalTimeLeftUnitsTitleAttribute\" title=\"Learn more\" target=\"_blank\"><span\n              class=\"fe fe-help-circle\"></span></a>\n        </h4>\n        <form action=\"https://fund.us17.list-manage.com/subscribe/post?u=9c0647dcb587985ed6121cdf6&amp;id=150e0f091e\"\n          method=\"post\" id=\"mc-embedded-subscribe-form\" name=\"mc-embedded-subscribe-form\"\n          class=\"validate mb-4 text-center\" target=\"_blank\" novalidate>\n          <label class=\"text-secondary\" for=\"mce-EMAIL\" i18n=\"@@modalBeNotifiedByEmail\">Be notified by email 👇.</label>\n          <div class=\"input-group input-group-lg\">\n            <input class=\"form-control\" type=\"email\" value=\"\" name=\"EMAIL\" id=\"mce-EMAIL\" i18n-placeholder=\"@@investorSellBtksModalEmailNotificationPlaceholder\" placeholder=\"myemail@address.com\" required>\n            <div style=\"position: absolute; left: -5000px;\" aria-hidden=\"true\"><input type=\"text\"\n                name=\"b_9c0647dcb587985ed6121cdf6_150e0f091e\" tabindex=\"-1\" value=\"\"></div>\n            <div class=\"input-group-append bg-black\">\n              <button class=\"btn btn-dark btn-lg btn-block\" name=\"subscribe\" id=\"mc-embedded-subscribe\">\n                <span class=\"fe fe-send\"></span>\n              </button>\n            </div>\n          </div>\n        </form>\n        <div class=\"row text-center mb-4\">\n          <div class=\"col\">\n            <p class=\"text-secondary mb-2 text-center\" i18n=\"@@modalFollowUs\">Or follow us</p>\n            <a href=\"https://t.me/betokenfund\" class=\"btn btn-rounded-circle btn-white mr-3\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/telegram.svg\" alt=\"telegram logo\" height=\"20\">\n            </a>\n            <a href=\"https://twitter.com/betokenfund\" class=\"btn btn-rounded-circle btn-white mr-3\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/twitter.svg\" alt=\"twitter logo\" height=\"20\">\n            </a>\n            <a href=\"https://medium.com/betoken\" class=\"btn btn-rounded-circle btn-white mr-3\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/medium.svg\" alt=\"medium logo\" height=\"20\">\n            </a>\n            <a href=\"https://github.com/Betoken\" class=\"btn btn-rounded-circle btn-white\" target=\"_blank\">\n              <img class=\"mx-auto\" src=\"assets/img/icons/github.svg\" alt=\"medium logo\" height=\"20\">\n            </a>\n          </div>\n        </div>\n      </div>\n\n    </div>\n  </div>\n</div><!-- / modal -->\n");

